CXX          = g++ -fno-strict-aliasing -static -fsample-profile -fdump-tree-sample_profile -g
FC           = openf90 -m32 -gnu4 -static
#FLD = pathf90 
#F77LD = pathf90

#####################################################################
# Optimization
#####################################################################
default=peak=default=default:
